import "./ExpenseItem.css";
function ExpenseItem() {
    const ezpenseDate=new Date(2022,2,1)
    const expenseDescription="Course bought"
    const expenseValue=32

  return (
    <div>
      <div className="expense-item">
        <div>{expenseDate.toISOString()} </div>
        <div className="expense-item__description">
          <h2>Car Insurance</h2>
          <div className="expense-item__price">Rs 120</div>
        </div>
      </div>
    </div>
  );
}

export default ExpenseItem;
